import 'bootstrap/dist/css/bootstrap.min.css';


const pessoas = [


{
  email : "Bruno",
  senha : "71240"
},
{
  email : "Ivan",
  senha : "002205"
}
]


function PageCadastros() {
  return (
  
    <ul className="list-group">

        {pessoas.map(element => ( 
          <li className="list-group-item">{element.email + " " + element.senha}</li>
        ))}
    </ul>

  );
}

export default PageCadastros;
